import React from 'react'

export default function Netflix() {
    return (
        <>
            <h1>Netflix Best</h1>
            <p>This show best from Netflix 2021</p>
            <ol>
                <li>GOT</li>
                <li>F.R.I.E.N.D.S</li>
                <li>Lock</li>
                <li>Marvel</li>
                <li>Red</li>

            </ol>
            <p>my num is {Math.floor(Math.random() * 100)}</p>
            <p>my num is {Math.floor(Math.random() * 100)}</p>
        </>
    )
}

// export default Netflix;
